import React from 'react'
import { useQuery, gql } from '@apollo/client'

const CATEGORY = gql`
  query GetCategory($id: ID!) {
    category(id: $ID) {
      id
      attributes {
        Name
        reviews {
          data {
            attributes {
              title
              rating
              body
            }
          }
        }
      }
    }
  }
`

export default function Category() {
  return (
    <div>
      Categories
    </div>
  )
}
